import React from 'react'

function Sidebar({topanime}) {
    return (
        <aside>
           <nav className="navFlex">
               <h3>top anime</h3>
               {topanime.map(anime=>(
               <a href="#" target="_blank" rel="noreferrer">
                <anime className="value"></anime>
               </a>          
               ))}

           </nav>
        </aside>
    )
}

export default Sidebar
